import React, { useState } from "react";
import "./App.css";

export default function App() {
  const [value, setValue] = useState([]);
  const [value1, setValue2] = useState([]);

  const onChangeValue = (e) => setValue(e.target.value);
  const onChangeValue1 = (e) => setValue2(e.target.value);

  const handleSubmit = (event) => {
    alert("A name was submitted: " + value + value1);
    event.preventDefault();
  };

  return (
    <div className="container">
      <form onSubmit={handleSubmit}>
        <label>
          Name:
          <input id="name" value={value} onChange={onChangeValue} />
        </label>
        <label>
          Email:
          <input id="mail" value={value1} onChange={onChangeValue1} />
        </label>
        <input type="submit" value="Submit" />
      </form>
    </div>
  );
}
